text:
 @victorhugodaniel7556  Flamengo x palmeiras x Atlético mineiro x Grêmio x Fluminense, esses times ainda vão se cruzar nas próximas rodadas finais do primeiro turno, a vantagem do Botafogo so vai aumentar em relação a eles.
supondo que o Botafogo que hoje tem 13 pontos de diferença pro sétimo, feche o primeiro turno com vinte pontos de diferença pro sétimo, ou mais de quinze pontos de diferença, como que o Botafogo vai terminar em sétimo? 
faz as contas ai, se o Botafogo vencer os sete jogos que restam, na nona rodada do returno vai ta praticamente vestido com o terno de campeão. a diferença de pontos e muito grande, ta difícil ate pro segundo colocado tirar, imagina o sétimo.

 @tailanreis318  liderança só importa mesmo em uma rodada: Na 38

Procura a história do campeonato BR de 2009 pra vc ver. 
São Paulo e Palmeiras ficaram alternando a liderança o campeonato inteiro, chegou na última rodada, Flamengo passou, campeão kkkkk do que valeu a liderança de São Paulo e Palmeiras? Porra nenhuma 😂 nem lembram mais

